    },
  },
});



const App = () => {

  const currentTheme = theme;
  console.log(currentTheme);

  return (

    <ThemeProvider theme={theme}>


    <div className="App">
        <Inventory />
    </div>

    </ThemeProvider>

  )
}

export default App
